import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'host';
}
<div class="toolbar">
  <img
    width="40"
    alt="Angular Logo"
    src="data:image/svg+xml;base64,"
  />
  <span>Host</span>
</div>
  <app-remote-button-link style="position: absolute;" [name]="'Godfather'" [url]="'https://twitch.tv/'"/>
